import * as React from "react";
import styled from "styled-components";
const Home: React.FC = () => {
  return (
    <Container>
      <p>
        <h1>커뮤니티</h1>
      </p>
    </Container>
  );
};

export default Home;

const Container = styled.div`
  display: flex;
  align-items: center;
  justify-content: center;
  flex-direction: column;
  border: solid grey 1px;
  p {
    width: 81px;
    font-weight: 700;
    font-size: 22px;
  }
`;
